        "future": "Votre avenir détient une compréhension spirituelle plus profonde et l'illumination intérieure. Vous vous dirigez vers devenir un phare de sagesse pour les autres. Le travail intérieur que vous faites maintenant éclairera votre chemin vers l'avant. Votre capacité de guidance spirituelle s'étend.",
        "daily": "Aujourd'hui, créez de l'espace pour la solitude et la réflexion intérieure. C'est un jour pour tenir un journal, méditer, ou contempler tranquillement. Votre sagesse intérieure a des messages pour vous. Reculez du bruit pour entendre votre vérité.",
        "block": "La peur d'être seul ou la recherche externe constante bloque la sagesse intérieure. Vous pourriez éviter l'introspection nécessaire par l'activité. L'isolation poussée trop loin devient solitude plutôt que sagesse. Équilibrez la solitude avec la connexion significative.",
