        "block": "Résister au changement ou essayer de contrôler la roue de la fortune crée la lutte. La peur du changement pourrait vous faire manquer des opportunités. L'attachement à comment les choses étaient empêche d'embrasser ce qui vient. Lâchez prise et laissez la roue tourner.",
        "flow": "Le flux vient en acceptant et travaillant avec les cycles de la vie. Votre énergie se meut le mieux quand vous êtes adaptable au changement. La fortune coule vers ceux qui se préparent pour l'opportunité. Restez centré alors que la roue tourne.",
