        "future": "Votre avenir détient la résolution des déséquilibres et injustices actuels. La vérité prévaudra dans les situations qui semblent floues maintenant. Votre engagement envers la justice crée un avenir plus équilibré. Les affaires légales ou officielles se résoudront en votre faveur.",
        "daily": "Aujourd'hui, approchez toutes les situations avec équité et intégrité. Prenez des décisions basées sur ce qui est juste plutôt que ce qui est pratique. Votre engagement envers la vérité attire des résultats positifs. Équilibrez vos propres besoins avec ceux des autres équitablement.",
        "block": "La malhonnêteté ou éviter les confrontations nécessaires crée un déséquilibre. Vous pourriez accepter un traitement injuste ou traiter injustement les autres. Éviter la vérité empêche la résolution. Faites face aux faits carrément pour progresser.",
        "flow": "Le flux vient par l'intégrité absolue et l'action équilibrée. Votre énergie se meut le mieux quand vous êtes équitable envers vous-même et les autres. La vérité crée des canaux clairs pour l'abondance. L'équilibre en toutes choses crée un flux durable.",
