        "daily": "Aujourd'hui, pratiquez voir tout sous un angle différent. Ne forcez pas le progrès - laissez les insights émerger. Votre pouvoir réside dans l'observation patiente plutôt que l'action. Lâchez prise du contrôle et voyez ce qui apparaît.",
        "block": "L'impatience ou l'incapacité à changer de perspective vous maintient bloqué. Lutter contre les pauses nécessaires crée la souffrance. La pensée rigide empêche la percée qui attend d'arriver. Abandonnez la résistance et trouvez la liberté.",
