        "block": "La peur des fins ou s'accrocher au passé mort bloque la transformation. Résister au changement nécessaire crée une souffrance prolongée. Essayer de faire revivre ce qui est destiné à mourir gaspille l'énergie. Acceptez les fins comme des portes vers les commencements.",
