        "daily": "Aujourd'hui, soyez préparé aux insights ou changements soudains. Ne résistez pas si les structures commencent à trembler. Votre ouverture au bouleversement minimise le choc. Voyez toute disruption comme intervention divine.",
        "block": "S'accrocher à la fausse sécurité ou structures dépassées crée de plus gros crashes. Résister au changement nécessaire fait tomber les tours plus durement. Construire sur de fausses fondations assure l'effondrement futur. Acceptez le changement structurel avec grâce.",
        "flow": "Le flow vient en relâchant l'attachement aux fausses structures. Votre énergie se libère par la déconstruction volontaire. Parfois tout doit tomber pour que la vérité tienne debout. Embrassez le bouleversement comme percée.",
